import axios from 'axios'
import { Link } from 'react-router-dom'

export default function PostsTeasers() {
    const [posts, setPosts] = useState([])
    const url = "http://localhost:3001";

    useEffect(() => {

        getAllPosts()

    }, [])

    const getAllPosts = async () => {
        const response = await axios.get(`${url}/posts`, {headers: {Authorization: "garrison"}})
        console.log(response)
        const posts = [...response.data]
        setPosts(posts)
    }


    return (
        <ul className="posts">

            {posts.map(post => 

            <li key={post.id}>

                <h3>{post.title}</h3>

                <p>{post.body}</p>

            </li>
            )}
        </ul>
    )
}
